import React from "react";

function HelloDiv() {
  return <div>
    <h1>Hello! My name is Americ Ngwije</h1>
    <p>Here are a few things that I like</p>
    <ul>
    <li>D&D</li>
    <li>Netflix</li>
    <li>Walking Outside</li>
    </ul>

  </div>;
}

export default HelloDiv;
